;;; {"type":"html","content":"<span class='clj-var'>#&#x27;kalman/kalman</span>","value":"#'kalman/kalman"}
;; <=

;; **
;;; ### Inference
;; **

;; @@
(def samples
  (->> (doquery :smc
             kalman
             [+observations+ 
              +obs-matrix+ +obs-cov+ 
              +trans-matrix+ +trans-cov+ 
              +init-mean+ +init-cov+]
             :number-of-particles 1000)
	   (take 10000)
       doall
       time))
